import { Link } from "react-router-dom";
import logo from "../media/logo.png";
const Header = () => {
  return (
    <div>
      <nav className="p-4 text-primary font-bold flex justify-between border-b-4 bg-white">
        <img className="w-10 h-10" src={logo} alt="buzz..." />
        <div className="header">Buzz... - Christy's game platform</div>
        <div>
          <Link to="/" className="mx-2">
            Home
          </Link>
          <Link to="/games" className="mx-2">
            Games
          </Link>
        </div>
      </nav>
    </div>
  );
};

export default Header;
